description:
nhà mới dân xây chắc chắn – thang máy xịn - full nội thất- ngõ 3m ba gác đua - vài bước ra phố _ 6tầng 1tum – 33m2 – 9,3 tỷ 
+ mô tả:
- vị trí đẹp, ngõ cực thoáng sáng, gần phố, gần chợ, tiện ích xung quanh không thiếu gì;
- xung quanh là nhiều trường đại học lớn như đh thủ đô, đh quốc gia, sư phạm 1, đh gtvt, hv báo chí, hv ngoại giao, đh ngoại thương,...;
- kích thước vàng, công năng vàng, có thể vừa ở, vừa cho thuê. 
+ nhà thiết kế 6 tầng + 1 tum, khung btct (mặt tiền: 5m), thang máy hiện đại.
- tầng 1: phòng khách + để xe +wc;
- tầng 2,3,4: mỗi tầng 1 phòng ngủ + wc;
- tầng 5 : bếp + wc;
- tầng 6: tum và sân phơi.
nhà xây mới, cđt xây chất lượng, các phòng đều tràn ngập ánh sáng, full đầy đủ nội thất.
giá: 9,3tỷ
 sổ đỏ vuông vắn chính chủ, cất két sẵn sàng giao dịch.
